import "core-js/modules/es.array.push.js";
export default {
  data() {
    return {
      isCalling: false
    };
  },
  computed: {
    taxiData() {
      return this.$store.getters["phone/getTaxiData"];
    }
  },
  methods: {
    onCallTaxi() {
      this.$callClient("W:Phone:Taxi:CallTaxi");
    },
    onBecameDriver() {
      if (this.taxiData.Executor.isWorking) {
        this.$router.push("/Phone/TaxiApp/orderList");
      } else {
        this.$router.push("/Phone/TaxiApp/getWork");
      }
    }
  }
};
